window.bookSummaryJSON = "<p>We live across the thousand dunes with grit in our teeth and sand in our homes. No one will come for us. No one will save us. This is our life, diving for remnants of the old world so that we may build what the wind destroys. No one is looking down on us. Those constellations in the night sky? Those are the backs of gods we see.</p>"; 
